import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailRoundedIcon from '@mui/icons-material/EmailRounded';
import InstagramIcon from '@mui/icons-material/Instagram';
import CopyrightRoundedIcon from '@mui/icons-material/CopyrightRounded';

const Footer = () => {
    return (
        <div className="flex flex-col md:flex-row md:justify-between gap-3">

            <div className="md:w-1/2 w-full flex justify">
                <p className="text-xs font-medium">
                    <span><CopyrightRoundedIcon className='px-1 pb-1' /></span>
                    2024 DIANNE FABIANO
                </p>
            </div>

            <div className="md:w-1/2 w-full flex justify-end md:gap-4 gap-2">
                <a href='https://www.instagram.com/yhianiee' target='_blank' className='hover:text-primary'>
                    <InstagramIcon />
                </a>
                <a href='mailto:fabianodianne@gmail.com' className='hover:text-primary'>
                    <EmailRoundedIcon />
                </a>
                <a href='https://www.linkedin.com/in/dianne-fabiano/' className='hover:text-primary'>
                    <LinkedInIcon />
                </a>
                <a href='https://github.com/fabianodianne' className='hover:text-primary'>
                    <GitHubIcon />
                </a>
            </div>

        </div>
    );
};

export default Footer;
